  return (
    <form class=" row g-3 needs-validation" novalidate>
      <input
        type="email"
        class="form-control"
        id="floatingInput"
        placeholder="name@example.com"
      ></input>
      <label for="floatingInput">Email address</label>
    </form>
  );
};

